In Nightly Rust today you can use the yield keyword. Basically using this keyword in a closure, converts it to a generator. A closure could look like this before we had a concept of Pin: #![feature(generators, generator_trait)]
use std::ops::{Generator, GeneratorState}; fn main() { let a: i32 = 4; let mut gen = move || { println!("Hello"); yield a * 2; println!("world!"); }; if let GeneratorState::Yielded(n) = gen.resume() { println!("Got value {}", n); } if let GeneratorState::Complete(()) = gen.resume() { () };
} Early on, before there was a consensus about the design of Pin, this compiled to something looking similar to this: fn main() { let mut gen = GeneratorA::start(4); if let GeneratorState::Yielded(n) = gen.resume() { println!("Got value {}", n); } if let GeneratorState::Complete(()) = gen.resume() { () };
} // If you've ever wondered why the parameters are called Y and R the naming from
// the original rfc most likely holds the answer
enum GeneratorState<Y, R> { Yielded(Y), // originally called `Yield(Y)` Complete(R), // originally called `Return(R)`
} trait Generator { type Yield; type Return; fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return>;
} enum GeneratorA { Enter(i32), Yield1(i32), Exit,
} impl GeneratorA { fn start(a1: i32) -> Self { GeneratorA::Enter(a1) }
} impl Generator for GeneratorA { type Yield = i32; type Return = (); fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return> { // lets us get ownership over current state match std::mem::replace(self, GeneratorA::Exit) { GeneratorA::Enter(a1) => { /*----code before yield----*/ println!("Hello"); let a = a1 * 2; *self = GeneratorA::Yield1(a); GeneratorState::Yielded(a) } GeneratorA::Yield1(_) => { /*-----code after yield-----*/ println!("world!"); *self = GeneratorA::Exit; GeneratorState::Complete(()) } GeneratorA::Exit => panic!("Can't advance an exited generator!"), } }
} The yield keyword was discussed first in RFC#1823 and in RFC#1832 . Now that you know that the yield keyword in reality rewrites your code to become a state machine, you'll also know the basics of how await works. It's very similar. Now, there are some limitations in our naive state machine above. What happens when you have a borrow across a yield point? We could forbid that, but one of the major design goals for the async/await syntax has been to allow this . These kinds of borrows were not possible using Futures 1.0 so we can't let this limitation just slip and call it a day yet. Instead of discussing it in theory, let's look at some code. We'll use the optimized version of the state machines which is used in Rust today. For a more in depth explanation see Tyler Mandry's excellent article: How Rust optimizes async/await let mut generator = move || { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; yield borrowed.len(); println!("{} world!", borrowed); }; We'll be hand-coding some versions of a state-machines representing a state machine for the generator defined aboce. We step through each step "manually" in every example, so it looks pretty unfamiliar. We could add some syntactic sugar like implementing the Iterator trait for our generators which would let us do this: while let Some(val) = generator.next() { println!("{}", val);
} It's a pretty trivial change to make, but this chapter is already getting long. Just keep this in the back of your head as we move forward. Now what does our rewritten state machine look like with this example? # enum GeneratorState<Y, R> {
# Yielded(Y), # Complete(R),
# }
# # trait Generator {
# type Yield;
# type Return;
# fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return>;
# } enum GeneratorA { Enter, Yield1 { to_borrow: String, borrowed: &String, // uh, what lifetime should this have? }, Exit,
} # impl GeneratorA {
# fn start() -> Self {
# GeneratorA::Enter
# }
# } impl Generator for GeneratorA { type Yield = usize; type Return = (); fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return> { // lets us get ownership over current state match std::mem::replace(self, GeneratorA::Exit) { GeneratorA::Enter => { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; // <--- NB! let res = borrowed.len(); *self = GeneratorA::Yield1 {to_borrow, borrowed}; GeneratorState::Yielded(res) } GeneratorA::Yield1 {to_borrow, borrowed} => { println!("Hello {}", borrowed); *self = GeneratorA::Exit; GeneratorState::Complete(()) } GeneratorA::Exit => panic!("Can't advance an exited generator!"), } }
} If you try to compile this you'll get an error (just try it yourself by pressing play). What is the lifetime of &String. It's not the same as the lifetime of Self. It's not static. Turns out that it's not possible for us in Rusts syntax to describe this lifetime, which means, that to make this work, we'll have to let the compiler know that we control this correctly ourselves. That means turning to unsafe. Let's try to write an implementation that will compiler using unsafe. As you'll see we end up in a self referential struct . A struct which holds references into itself. As you'll notice, this compiles just fine! enum GeneratorState<Y, R> { Yielded(Y), Complete(R), } trait Generator { type Yield; type Return; fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return>;
} enum GeneratorA { Enter, Yield1 { to_borrow: String, borrowed: *const String, // NB! This is now a raw pointer! }, Exit,
} impl GeneratorA { fn start() -> Self { GeneratorA::Enter }
}
impl Generator for GeneratorA { type Yield = usize; type Return = (); fn resume(&mut self) -> GeneratorState<Self::Yield, Self::Return> { match self { GeneratorA::Enter => { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; let res = borrowed.len(); *self = GeneratorA::Yield1 {to_borrow, borrowed: std::ptr::null()}; // NB! And we set the pointer to reference the to_borrow string here if let GeneratorA::Yield1 {to_borrow, borrowed} = self { *borrowed = to_borrow; } GeneratorState::Yielded(res) } GeneratorA::Yield1 {borrowed, ..} => { let borrowed: &String = unsafe {&**borrowed}; println!("{} world", borrowed); *self = GeneratorA::Exit; GeneratorState::Complete(()) } GeneratorA::Exit => panic!("Can't advance an exited generator!"), } }
} Remember that our example is the generator we crated which looked like this: let mut gen = move || { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; yield borrowed.len(); println!("{} world!", borrowed); }; Below is an example of how we could run this state-machine and as you see it does what we'd expect. But there is still one huge problem with this: pub fn main() { let mut gen = GeneratorA::start(); let mut gen2 = GeneratorA::start(); if let GeneratorState::Yielded(n) = gen.resume() { println!("Got value {}", n); } if let GeneratorState::Yielded(n) = gen2.resume() { println!("Got value {}", n); } if let GeneratorState::Complete(()) = gen.resume() { () };
}
