Thanks to PR#45337 you can actually run code like the one in our example in Rust today using the static keyword on nightly. Try it for yourself: Beware that the API is changing rapidly. As I was writing this book, generators had an API change adding support for a "resume" argument to get passed into the generator closure. Follow the progress on the tracking issue #4312 for RFC#033 . #![feature(generators, generator_trait)]
use std::ops::{Generator, GeneratorState}; pub fn main() { let gen1 = static || { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; yield borrowed.len(); println!("{} world!", borrowed); }; let gen2 = static || { let to_borrow = String::from("Hello"); let borrowed = &to_borrow; yield borrowed.len(); println!("{} world!", borrowed); }; let mut pinned1 = Box::pin(gen1); let mut pinned2 = Box::pin(gen2); if let GeneratorState::Yielded(n) = pinned1.as_mut().resume(()) { println!("Gen1 got value {}", n); } if let GeneratorState::Yielded(n) = pinned2.as_mut().resume(()) { println!("Gen2 got value {}", n); }; let _ = pinned1.as_mut().resume(()); let _ = pinned2.as_mut().resume(());
}

