Let's start where we left off in the last chapter by making the problem we saw using a self-referential struct in our generator a lot simpler by making some self-referential structs that are easier to reason about than our state machines: For now our example will look like this: use std::pin::Pin; #[derive(Debug)]
struct Test { a: String, b: *const String,
} impl Test { fn new(txt: &str) -> Self { let a = String::from(txt); Test { a, b: std::ptr::null(), } } fn init(&mut self) { let self_ref: *const String = &self.a; self.b = self_ref; } fn a(&self) -> &str { &self.a } fn b(&self) -> &String { unsafe {&*(self.b)} }
} Let's walk through this example since we'll be using it the rest of this chapter. We have a self-referential struct Test. Test needs an init method to be created which is strange but we'll need that to keep this example as short as possible. Test provides two methods to get a reference to the value of the fields a and b. Since b is a reference to a we store it as a pointer since the borrowing rules of Rust doesn't allow us to define this lifetime. Now, let's use this example to explain the problem we encounter in detail. As you see, this works as expected: fn main() { let mut test1 = Test::new("test1"); test1.init(); let mut test2 = Test::new("test2"); test2.init(); println!("a: {}, b: {}", test1.a(), test1.b()); println!("a: {}, b: {}", test2.a(), test2.b()); }
