For completeness let's remove some unsafe and the need for an init method at the cost of a heap allocation. Pinning to the heap is safe so the user doesn't need to implement any unsafe code: use std::pin::Pin;
use std::marker::PhantomPinned; #[derive(Debug)]
struct Test { a: String, b: *const String, _marker: PhantomPinned,
} impl Test { fn new(txt: &str) -> Pin<Box<Self>> { let a = String::from(txt); let t = Test { a, b: std::ptr::null(), _marker: PhantomPinned, }; let mut boxed = Box::pin(t); let self_ptr: *const String = &boxed.as_ref().a; unsafe { boxed.as_mut().get_unchecked_mut().b = self_ptr }; boxed } fn a<'a>(self: Pin<&'a Self>) -> &'a str { &self.get_ref().a } fn b<'a>(self: Pin<&'a Self>) -> &'a String { unsafe { &*(self.b) } }
} pub fn main() { let mut test1 = Test::new("test1"); let mut test2 = Test::new("test2"); println!("a: {}, b: {}",test1.as_ref().a(), test1.as_ref().b()); println!("a: {}, b: {}",test2.as_ref().a(), test2.as_ref().b());
} The fact that it's safe to pin a heap allocated value even if it is !Unpin makes sense. Once the data is allocated on the heap it will have a stable address. There is no need for us as users of the API to take special care and ensure that the self-referential pointer stays valid. There are ways to safely give some guarantees on stack pinning as well, but right now you need to use a crate like pin_project to do that.

