} enum GeneratorA { Enter, Yield1 { to_borrow: String, borrowed: *const String, }, Exit,
} impl GeneratorA { fn start() -> Self { GeneratorA::Enter }
} // This tells us that the underlying pointer is not safe to move after pinning.
