In Rust we call an interruptible task a Future. Futures has a well defined interface, which means they can be used across the entire ecosystem. We can chain these Futures so that once a "leaf future" is ready we'll perform a set of operations. These chained operations can spawn new leaf futures themselves. Our Future implementation looks like this: // This is the definition of our `Waker`. We use a regular thread-handle here.
// It works but it's not a good solution. It's easy to fix though, I'll explain
// after this code snippet.
#[derive(Clone)]
struct MyWaker { thread: thread::Thread,
} // This is the definition of our `Future`. It keeps all the information we
// need. This one holds a reference to our `reactor`, that's just to make
// this example as easy as possible. It doesn't need to hold a reference to
// the whole reactor, but it needs to be able to register itself with the
// reactor.
#[derive(Clone)]
pub struct Task { id: usize, reactor: Arc<Mutex<Reactor>>, data: u64, is_registered: bool,
} // These are function definitions we'll use for our waker. Remember the
// "Trait Objects" chapter earlier.
fn mywaker_wake(s: &MyWaker) { let waker_ptr: *const MyWaker = s; let waker_arc = unsafe {Arc::from_raw(waker_ptr)}; waker_arc.thread.unpark();
} // Since we use an `Arc` cloning is just increasing the refcount on the smart
// pointer.
fn mywaker_clone(s: &MyWaker) -> RawWaker { let arc = unsafe { Arc::from_raw(s) }; std::mem::forget(arc.clone()); // increase ref count RawWaker::new(Arc::into_raw(arc) as *const (), &VTABLE)
} // This is actually a "helper funtcion" to create a `Waker` vtable. In contrast
// to when we created a `Trait Object` from scratch we don't need to concern
// ourselves with the actual layout of the `vtable` and only provide a fixed
// set of functions
const VTABLE: RawWakerVTable = unsafe { RawWakerVTable::new( |s| mywaker_clone(&*(s as *const MyWaker)), // clone |s| mywaker_wake(&*(s as *const MyWaker)), // wake |s| mywaker_wake(*(s as *const &MyWaker)), // wake by ref |s| drop(Arc::from_raw(s as *const MyWaker)), // decrease refcount )
}; // Instead of implementing this on the `MyWaker` oject in `impl Mywaker...` we
// just use this pattern instead since it saves us some lines of code.
fn waker_into_waker(s: *const MyWaker) -> Waker { let raw_waker = RawWaker::new(s as *const (), &VTABLE); unsafe { Waker::from_raw(raw_waker) }
} impl Task { fn new(reactor: Arc<Mutex<Reactor>>, data: u64, id: usize) -> Self { Task { id, reactor, data, is_registered: false, } }
} // This is our `Future` implementation
impl Future for Task { // The output for our kind of `leaf future` is just an `usize`. For other // futures this could be something more interesting like a byte array. type Output = usize; fn poll(mut self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { let mut r = self.reactor.lock().unwrap(); // we check with the `Reactor` if this future is in its "readylist" // i.e. if it's `Ready` if r.is_ready(self.id) { // if it is, we return the data. In this case it's just the ID of // the task since this is just a very simple example. Poll::Ready(self.id) } else if self.is_registered { // If the future is registered alredy, we just return `Pending` Poll::Pending } else { // If we get here, it must be the first time this `Future` is polled // so we register a task with our `reactor` r.register(self.data, cx.waker().clone(), self.id); // oh, we have to drop the lock on our `Mutex` here because we can't // have a shared and exclusive borrow at the same time drop(r); self.is_registered = true; Poll::Pending } }
} This is mostly pretty straight forward. The confusing part is the strange way we need to construct the Waker, but since we've already created our own trait objects from raw parts, this looks pretty familiar. Actually, it's even a bit easier. We use an Arc here to pass out a ref-counted borrow of our MyWaker. This is pretty normal, and makes this easy and safe to work with. Cloning a Waker is just increasing the refcount in this case. Dropping a Waker is as easy as decreasing the refcount. Now, in special cases we could choose to not use an Arc. So this low-level method is there to allow such cases. Indeed, if we only used Arc there is no reason for us to go through all the trouble of creating our own vtable and a RawWaker. We could just implement a normal trait. Fortunately, in the future this will probably be possible in the standard library as well. For now, this trait lives in the nursery , but my guess is that this will be a part of the standard library after som maturing. We choose to pass in a reference to the whole Reactor here. This isn't normal. The reactor will often be a global resource which let's us register interests without passing around a reference.

