This is the home stretch, and not strictly Future related, but we need one to have an example to run. Since concurrency mostly makes sense when interacting with the outside world (or at least some peripheral), we need something to actually abstract over this interaction in an asynchronous way. This is the Reactors job. Most often you'll see reactors in Rust use a library called Mio , which provides non blocking APIs and event notification for several platforms. The reactor will typically give you something like a TcpStream (or any other resource) which you'll use to create an I/O request. What you get in return is a Future. If the Reactor is registered as a global resource (which is pretty normal), our Task in would instead be a special TcpStream which registers interest with the global Reactor and no reference is needed. We can call this kind of Future a "leaf Future", since it's some operation we'll actually wait on and which we can chain operations on which are performed once the leaf future is ready. The reactor we create here will also create leaf-futures , accept a waker and call it once the task is finished. The task we're implementing is the simplest I could find. It's a timer that only spawns a thread and puts it to sleep for a number of seconds we specify when acquiring the leaf-future. To be able to run the code here in the browser there is not much real I/O we can do so just pretend that this is actually represents some useful I/O operation for the sake of this example. Our Reactor will look like this: // This is a "fake" reactor. It does no real I/O, but that also makes our
// code possible to run in the book and in the playground
struct Reactor { // we need some way of registering a Task with the reactor. Normally this // would be an "interest" in an I/O event dispatcher: Sender<Event>, handle: Option<JoinHandle<()>>, // This is a list of tasks that are ready, which means they should be polled // for data. readylist: Arc<Mutex<Vec<usize>>>,
} // We just have two kind of events. An event called `Timeout`
// and a `Close` event to close down our reactor.
#[derive(Debug)]
enum Event { Close, Timeout(Waker, u64, usize),
} impl Reactor { fn new() -> Self { // The way we register new events with our reactor is using a regular // channel let (tx, rx) = channel::<Event>(); let readylist = Arc::new(Mutex::new(vec![])); let rl_clone = readylist.clone(); // This `Vec` will hold handles to all threads we spawn so we can // join them later on and finish our programm in a good manner let mut handles = vec![]; // This will be the "Reactor thread" let handle = thread::spawn(move || { for event in rx { let rl_clone = rl_clone.clone(); match event { // If we get a close event we break out of the loop we're in Event::Close => break, Event::Timeout(waker, duration, id) => { // When we get an event we simply spawn a new thread // which will simulate some I/O resource... let event_handle = thread::spawn(move || { //... by sleeping for the number of seconds // we provided when creating the `Task`. thread::sleep(Duration::from_secs(duration)); // When it's done sleeping we put the ID of this task // on the "readylist" rl_clone.lock().map(|mut rl| rl.push(id)).unwrap(); // Then we call `wake` which will wake up our // executor and start polling the futures waker.wake(); }); handles.push(event_handle); } } } // When we exit the Reactor we first join all the handles on // the child threads we've spawned so we catch any panics and // release any resources. for handle in handles { handle.join().unwrap(); } }); Reactor { readylist, dispatcher: tx, handle: Some(handle), } } fn register(&mut self, duration: u64, waker: Waker, data: usize) { // registering an event is as simple as sending an `Event` through // the channel. self.dispatcher .send(Event::Timeout(waker, duration, data)) .unwrap(); } fn close(&mut self) { self.dispatcher.send(Event::Close).unwrap(); } // We need a way to check if any event's are ready. This will simply // look through the "readylist" for an event macthing the ID we want to // check for. fn is_ready(&self, id_to_check: usize) -> bool { self.readylist .lock() .map(|rl| rl.iter().any(|id| *id == id_to_check)) .unwrap() }
} // When our `Reactor` is dropped we join the reactor thread with the thread
// owning our `Reactor` so we catch any panics and release all resources.
// It's not needed for this to work, but it really is a best practice to join
// all threads you spawn.
impl Drop for Reactor { fn drop(&mut self) { self.handle.take().map(|h| h.join().unwrap()).unwrap(); }
} It's a lot of code though, but essentially we just spawn off a new thread and make it sleep for some time which we specify when we create a Task. Now, let's test our code and see if it works. This code is actually runnable if you press the "play" button. Since we're sleeping for a couple of seconds here, just give it some time to run. In the last chapter we have the whole 200 lines in an editable window . You can also copy that or edit it right in this book. # use std::{
